];

const imagesContainer = document.getElementById('images');
const resultsTable = document.querySelector('#resultsTable tbody');

imageData.forEach((data, idx) => {
  const block = document.createElement('div');
  block.className = 'image-block';

  const label = document.createElement('div');
  label.className = 'label';
  label.textContent = data.label;

  const canvas = document.createElement('canvas');
  canvas.width = 800;
  canvas.height = 600;

  const ctx = canvas.getContext('2d');
  const img = new Image();
  img.src = data.src;

  let scale = 1;
  let points = [];

  img.onload = () => {
    scale = Math.min(800 / img.width, 600 / img.height, 1);
    canvas.width = img.width * scale;
    canvas.height = img.height * scale;
    ctx.drawImage(img, 0, 0, canvas.width, canvas.height);
  };

  canvas.addEventListener('click', function (event) {
    const rect = canvas.getBoundingClientRect();
    const x = (event.clientX - rect.left) / scale;
    const y = (event.clientY - rect.top) / scale;

    points.push({ x, y });

    if (points.length === 2) {
      ctx.drawImage(img, 0, 0, canvas.width, canvas.height);
      drawLine(points[0], points[1]);
      const angle = calculateBearing(points[0], points[1]);
      addToTable(data.label, angle);
      points = [];
    }
  });

  function drawLine(p1, p2) {
    ctx.beginPath();
    ctx.moveTo(p1.x * scale, p1.y * scale);
    ctx.lineTo(p2.x * scale, p2.y * scale);
    ctx.strokeStyle = 'red';
    ctx.lineWidth = 2;
    ctx.stroke();
  }

  function calculateBearing(p1, p2) {
    const dx = p2.x - p1.x;
    const dy = p2.y - p1.y;
    let angle = Math.atan2(dx, -dy) * (180 / Math.PI);
    if (angle < 0) angle += 360;
    return angle;
  }

  function addToTable(label, angle) {
    const row = document.createElement('tr');
    const timeCell = document.createElement('td');
    const angleCell = document.createElement('td');
    timeCell.textContent = label;
    angleCell.textContent = angle.toFixed(2);
    row.appendChild(timeCell);
    row.appendChild(angleCell);
    resultsTable.appendChild(row);
  }

  block.appendChild(label);
  block.appendChild(canvas);
  imagesContainer.appendChild(block);
});

</script></body></html>
